        args.push('-ac', '2');
        args.push('-shortest');
      }

      args.push(
        '-c:v', 'libx264',
        '-profile:v', 'baseline',
        '-level', '3.0',
        '-b:v', '1500k',
        '-maxrate', '1500k',
        '-bufsize', '3000k',
        '-pix_fmt', 'yuv420p',
        '-vf', 'format=yuv420p,scale=trunc(iw/2)*2:trunc(ih/2)*2,fps=24',
        '-r', '24',
        '-g', '48',
        '-keyint_min', '24',
        '-preset', 'slow',
        '-tune', hasImages ? 'stillimage' : 'film',
        '-movflags', '+faststart',
        '-avoid_negative_ts', 'make_zero',
