      case "rendering_frames": return "Rendering frames...";
      case "processing_audio": return "Processing audio tracks...";
      case "encoding": return `Encoding (${exportSettings.compatibilityMode} mode)...`;
      case "downloading": return "Saving file...";
      case "completed": return "✅ Export completed! Video should play properly.";
      case "error": return "An error occurred";
      case "ready": return `Ready to export (${actualTimelineItems.length} elements, ${exportSettings.compatibilityMode} mode)`;
      default: return "Waiting...";
    }
  };

  const getStageIcon = () => {
    switch (exportStage) {
      case "completed": return <Check size={20} className="text-green-600" />;
